import React from 'react'
import Container from 'react-bootstrap/Container';
import { Row } from 'react-bootstrap';

export const Keep = () => {
    return (
        <section className="mt-5">
        <Container>
            <Row>
                <textarea className="text-center" ></textarea>
            </Row>
        </Container>
        </section>
    )
}
